SELECT
    block_number
    ,block_timestamp
    ,transaction_index
    ,log_index
    ,transaction_hash
    ,address AS token_address
    ,concat('0x',substring(topic1,25,40)) AS "from"
    ,concat('0x',substring(topic2,25,40) ) AS "to"
    ,toString(
        reinterpretAsUInt256(
            reverse(unhex(data))
        )
    ) AS "value"
FROM {{ source('execution','logs') }}
WHERE
    topic0 = 'ddf252ad1be2c89b69c2b068fc378daa952ba7f163c4a11628f55a4df523b3ef'
    AND address = 'e91d153e0b41518a2ce8dd3d7944fa863463a97d'
    AND block_timestamp < today()
    {{ apply_monthly_incremental_filter('block_timestamp', 'block_timestamp', 'true') }}

model.gnosis_dbt.execution_state_size_da.raw_code:
{{ 
    config(
        materialized='incremental',
        incremental_strategy='delete+insert',
        engine='ReplacingMergeTree()',
        order_by='(date)',
        unique_key='(date)',
        partition_by='toStartOfMonth(date)'
    )
}}


WITH

state_size_diff_daily AS (
    SELECT 
        date
        ,bytes_diff
    FROM 
        {{ ref('execution_state_size_diff_daily') }}
    {{ apply_monthly_incremental_filter('date','date') }}
),

{% if is_incremental() %}
last_partition_value AS (
    SELECT 
        bytes
    FROM 
        {{ this }}
    WHERE
        toStartOfMonth(date) = (
            SELECT addMonths(max(toStartOfMonth(date)), -1)
            FROM {{ this }}
        )
    ORDER BY date DESC
    LIMIT 1
),
{% endif %}

final AS (
    SELECT
        date
        ,SUM(bytes_diff) OVER (ORDER BY date ASC) 
        {% if is_incremental() %}
            + (SELECT bytes FROM last_partition_value)
        {% endif %}
        AS bytes
    FROM state_size_diff_daily
)

SELECT * FROM final

model.gnosis_dbt.execution_txs_info_dail.raw_code:
{{ 
    config(
        materialized='incremental',
        incremental_strategy='delete+insert',
        engine='ReplacingMergeTree()',
        order_by='(date, transaction_type, success)',
        unique_key='(date, transaction_type, success)',
        partition_by='toStartOfMonth(date)',
        settings={
            'allow_nullable_key': 1
        }
    ) 
}}


SELECT
    toStartOfDay(block_timestamp) AS date
    ,toString(transaction_type) AS transaction_type
    ,success
    ,COUNT(*) AS n_txs
    ,SUM(COALESCE(gas_used,0)) AS gas_used
    ,CAST(AVG(COALESCE(gas_price,0)) AS Int32) AS gas_price_avg
    ,CAST(median(COALESCE(gas_price,0)) AS Int32) AS gas_price_median
FROM {{ source('execution','transactions') }}
WHERE block_timestamp < today()
    {{ apply_monthly_incremental_filter('block_timestamp', 'date', 'true') }}
GROUP BY 1, 2, 3

model.gnosis_dbt.rwa_backedfi_prices_1d.raw_code:
{{ config(materialized='table') }}

{% set btickers = [
  'bC3M','bCOIN','bCSPX','bHIGH',
  'bIB01','bIBTA','bMSTR','bNVDA','TSLAx'
] %}

{% set fill_start = "2020-01-01" %}   -- safely before any token was listed
{% set unions = [] %}

{% for b in btickers %}
{% set sql %}
SELECT
  bticker,
  date,
  price
FROM (
    /* gather sparse rows, fill, forward-fill */
    SELECT
      '{{ b }}'       AS bticker,
      date,
      /* forward-fill price */
      last_value(price) IGNORE NULLS
        OVER (
          ORDER BY date
          ROWS BETWEEN UNBOUNDED PRECEDING AND CURRENT ROW
        ) AS price
    FROM (
        /* sparse daily data for this one ticker */
        SELECT
